import React from "react";

import Layout from "../Components/Layout";
import UserForm from "../Components/UserForm";

import "../Components/Header/index.scss";

const Home: React.FC = () => (
    <Layout>
        <UserForm type="login" />
    </Layout>
);

export default Home;
